styles:
      :root {
        --container-width: 56rem;
--color-scheme: light;
--base-font-family: '__SourceSans_be48ec', '__SourceSans_Fallback_be48ec';
--base-font-size: 1rem;
--base-line-height: 1.3;
--base-font-weight: 400;
--base-font-color: #252525;
--primary-heading-font-family: '__Bitter_92ac14', '__Bitter_Fallback_92ac14';
--primary-heading-font-size: 1.75rem;
--standard-heading-font-size: calc(var(--base-font-size) * 1.75);
--primary-heading-line-height: 1.5;
--primary-heading-font-weight: 700;
--primary-heading-font-color: var(--accent-primary-color);
--navigation-font-family: var(--primary-heading-font-family);
--navigation-font-size: 1.1rem;
--navigation-line-height: 1;
--navigation-sitename-font-size: 1.25rem;
--navigation-sitename-line-height: 1;
--navigation-font-weight: 400;
--navigation-font-color: var(--base-font-color);
--background-transparent-color: transparent;
--background-dimmed-color: #0000008C;
--background-base-color: #fff;
--background-base-textcolor: #000;
--background-secondary-color: #dfe2e8;
--background-secondary-textcolor: #252525;
--accent-primary-color: #121C43;
--accent-primary-textcolor: #fff;
--accent-secondary-color: #113E4F;
--accent-secondary-textcolor: #fff;
--border-radius: 0.25rem;
--base-button-style: filled;
--base-border: 1px solid var(--background-secondary-color);
--height-gap: 0.75rem;
--width-gap: 0.75rem;
--$_breakpoints: undefined;
--$_animation_name: undefined;
--website_id: undefined;
--id: undefined;
      }

      @media (min-width: 720px) {
        :root {
          --$_name: tablet;
--height-gap: 1.5rem;
--width-gap: 1rem;
        }
      }

      @media (min-width: 1024px) {
        :root {
          --$_name: desktop;
--height-gap: 1.5rem;
--width-gap: 2rem;
        }
